" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Pentetate indium disodium In-111: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?18/62/19427?source=see_link\">",
"    see \"Pentetate indium disodium In-111: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F13185902\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Indium DTPA In 111",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F13185904\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Radiopharmaceutical",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F13185939\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Cisternography:",
"     </b>",
"     Intrathecal (based on 70 kg patient): 0.5 mCi (18.5 MBq)",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F13185938\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Cisternography:",
"     </b>",
"     Intrathecal: Some institutions suggest a minimum dose to achieve a high diagnostic quality is 0.1 mCi (3.7 MBq).",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F13185905\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Radionuclide cisternography",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F13255271\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Other safety concerns:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Radiopharmaceutical: Use appropriate precaution for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use under supervision of experienced personnel. Should be stored in original lead container or adequate radiation shield.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F13185916\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Central nervous system: Aseptic meningitis, meningitis, pyrexia",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Dermatologic: Skin reactions",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Gastrointestinal: Vomiting",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F13185906\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Special handling:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Radiopharmaceutical: Use appropriate precautions for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use under supervision of individuals who have received training in the handling of radioactive materials and who are authorized by the applicable regulatory authority.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Disease-related concerns:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Renal impairment: Use with caution in patients with severe renal impairment.",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F13185908\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     C (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F13185909\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Animal studies have not been conducted. There are no adequate and well-controlled studies in pregnant women. Radiopharmaceuticals have the potential to cause fetal harm. Use during pregnancy only if clearly needed.",
"    </p>",
"   </div>",
"   <div class=\"block lac drugH1Div\" id=\"F13185910\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excretion in breast milk unknown/not recommended (per manufacturer)",
"    </p>",
"   </div>",
"   <div class=\"block brc drugH1Div\" id=\"F13185911\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Breast-Feeding Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     In one patient report, only 0.2% of the administered dose was excreted in breast milk, which would have resulted in an infant dose of less than 1 mrem (0.01 mSv) if breast-feeding had not been interrupted. This amount is so low that interruption of breast-feeding is not necessary (Johnson, 1995).",
"    </p>",
"   </div>",
"  </div>",
"  <div id=\"topicAgreement\">",
"   Use of UpToDate is subject to the",
"   <a class=\"licenseLink\" href=\"./license\" id=\"sla_in_page\" target=\"_blank\">",
"    Subscription and License Agreement",
"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Johnson TK and Stabin M, \"111In-DTPA Cisternography to Investigate a Possible Cerebrospinal Fluid (CSF) Leak,\"",
"      <i>",
"       J Nucl Med",
"      </i>",
"      , 1995, 36(9):1723-4.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?5/19/5426/abstract-text/7658238/pubmed\" id=\"7658238\" target=\"_blank\">",
"        7658238",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"   </ol>",
