"       The Wills Eye Manual",
"      </i>",
"      , Chapter 5, \"Conjunctiva/Sclera/Iris/External Disease,\" 4th ed, Kunimoto DY, Kanitkar KD, and Makar MS, eds, Philadelphia, PA: Lippincott Williams &amp; Wilkins, 2004.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Williams L, Malhotra Y, Murante B, et al, &ldquo;A Single-Blinded Randomized Clinical Trial Comparing Polymyxin B-Trimethoprim and Moxifloxacin for Treatment of Acute Conjunctivitis in Children,&rdquo;",
"      <i>",
"       J Pediatr",
"      </i>",
"      , 2013, 162(4):857-61.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?5/19/5429/abstract-text/23092529/pubmed\" id=\"23092529\" target=\"_blank\">",
"        23092529",
"       </a>",
"       ]",
"      </span>",
