var title_f5_19_5436="Early-onset GBS infection rx";
var content_f5_19_5436=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F71720&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F71720&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Intravenous treatment of early-onset group B streptococcal infections",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Site(s) of infection",
"       </td>",
"       <td class=\"subtitle1\">",
"        Empirical therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Definitive therapy*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Duration of therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Bacteremia/sepsis/pneumonia",
"       </td>",
"       <td>",
"        Ampicillin 150 mg/kg every 12 hours",
"       </td>",
"       <td rowspan=\"3\">",
"        Penicillin G: 150,000 to 200,000 units/kg per day divided every 6 to 8 hours",
"       </td>",
"       <td rowspan=\"3\">",
"        10 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gentamicin 4 mg/kg every 24 hours for infants born at &ge;35 weeks gestation; 3 mg/kg every 24 hours for infants born at &lt;35 weeks gestation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Meningitis",
"       </td>",
"       <td>",
"        Ampicillin 100 to 150 mg/kg every&nbsp;8 hours",
"       </td>",
"       <td rowspan=\"3\">",
"        Penicillin G: 250,000 to 450,000 units/kg per day divided every 8 hours",
"       </td>",
"       <td rowspan=\"3\">",
"        14 to 21 days",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gentamicin 4 mg/kg every 24 hours for infants born at &ge;35 weeks gestation; 3 mg/kg every 24 hours for infants born at &lt;35 weeks gestation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     GBS: Group B streptococcus; CSF: cerebrospinal fluid.",
"     <br>",
"      * Definitive therapy should not be started until GBS is identified by culture; clinical improvement is evident; and for meningitis, CSF is sterile at 24 to 48 hours of therapy.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       14 days is sufficient for uncomplicated cases of GBS meningitis.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: American Academy of Pediatrics. Group B streptococcal infections. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. p.680.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
